import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Reservation } from './Reservation';

export default function Reservations() {
    const [reservations, setReservation] = useState([]);

    useEffect(() => {
        axios.get("/api/reservations/full")
            .then(response => {
                setReservation(response.data);
            })
            .catch(error => {
                console.error("Klaida gaunant knygas:", error);
            });
    }, []);

    if (!reservations) {
        return <p className='txt'>Loading...</p>;
    }

    return (
        <div className="items-container">
            <h1 className="txt title">Rezervacijų sąrašas</h1>
            <div>
                {reservations.map(reservation => {
                    return <Reservation 
                     key={reservation.id}
                     id={reservation.id}
                     title={reservation.title}
                     days={reservation.days}
                     isPickUp={reservation.isQuickPickUp ? 'Taip' : 'Ne'}
                     totalPrice={reservation.totalPrice}
                     reservationEnd={new Date(reservation.reservationEnd).toLocaleDateString()}
                     bookType={reservation.isAudioBook ? 'Audioknyga' : 'Knyga'}/>
                })}
            </div>
        </div>
    );
}
